import React from 'react'
import PropTypes from 'prop-types'
export default function Error({mensaje}) {
    return (
    <p className="alert alert-danger error"> {mensaje}</p>
    )
}
Error.propTypes={
    mensaje : PropTypes.string.isRequired 
  }
